import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('var', () => {
    test('ok', async () => {
        const r1 = await request('http://var1.wproxy.org/index.html');
        expect(r1.data).toHaveProperty('json1', 1);
        expect(r1.data).toHaveProperty('json2', 2);
        expect(r1.data).toHaveProperty('json3', 3);
    });
});
